import * as React from 'react';
import {Card, Page} from '@shopify/polaris';
import BaseService from "../../commons/services/BaseService";
import {useEffect, useState} from "react";
import {getListUser, IResListUser} from "../../api/User";

const ListUser: React.FC<any> = () => {

    const [listUser, setListUser] = useState<IResListUser[]>([]);

    const getUsers = async () => {
        const res = await getListUser('https://fakestoreapi.com/users?page=1&limit=12');
        if (res.status === 200) {
            setListUser(res.body);
        }
    }

    useEffect(() => {
        getUsers()
    }, []);

    return (
        <Page
            fullWidth
            title="List user"
            pagination={{
                hasPrevious: true,
                hasNext: true,
            }}
        >
            {
                listUser.map(value => {
                    return(
                        <div style={{width: 400}} onClick={() => BaseService.pushNotify('success', '')}>
                            <Card title="Online store dashboard" sectioned>
                                <p>View a summary of your online storeâ€™s performance.</p>
                            </Card>
                        </div>
                    )
                })
            }
        </Page>
    )
}

export default ListUser;
